function.block:
{
uint32_t acc;
int acc_len;

acc = 0;
acc_len = 0;
while (len -- > 0) {
acc |= (uint32_t)src[len] << acc_len;
acc_len += 8;
if (acc_len >= 13) {
*dst ++ = acc & 0x1FFF;
acc >>= 13;
acc_len -= 13;
}
}
return acc;
}

{
uint32_t acc;
int acc_len;

acc = 0;
acc_len = 0;
while (len -- > 0) {
if (acc_len < 8) {
acc |= (*src ++) << acc_len;
acc_len += 13;
}
dst[len] = (unsigned char)acc;
acc >>= 8;
acc_len -= 8;
}
}

{
size_t u;
uint32_t cc;

cc = 0;
for (u = 0; u < len; u ++) {
int32_t z;

z = w[u] + cc;
d[u] = z & 0x1FFF;
cc = ARSH(z, 13);
}
return cc;
}

{
mul20(d, a, a);
}

{
uint32_t t[20];
uint32_t cc;
int i;

memcpy(t, d, sizeof t);
cc = 0;
for (i = 0; i < 20; i ++) {
uint32_t w;

w = t[i] - F256[i] - cc;
cc = w >> 31;
t[i] = w & 0x1FFF;
}
cc ^= 1;
CCOPY(cc, d, t, sizeof t);
return cc;
}

unit.typedef:
typedef struct {
uint32_t x[20];
uint32_t y[20];
uint32_t z[20];
} p256_jacobian;

function.block:
{
uint32_t t1[20], t2[20];
int i;
























memcpy(t1, P->z, sizeof P->z);
for (i = 0; i < 30; i ++) {
square_f256(t1, t1);
mul_f256(t1, t1, P->z);
}






memcpy(t2, P->z, sizeof P->z);
for (i = 1; i < 256; i ++) {
square_f256(t2, t2);
switch (i) {
case 31:
case 190:
case 221:
case 252:
mul_f256(t2, t2, t1);
break;
case 63:
case 253:
case 255:
mul_f256(t2, t2, P->z);
break;
}
}




mul_f256(t1, t2, t2);
mul_f256(P->x, t1, P->x);
mul_f256(t1, t1, t2);
mul_f256(P->y, t1, P->y);
reduce_final_f256(P->x);
reduce_final_f256(P->y);





mul_f256(P->z, P->z, t2);
reduce_final_f256(P->z);
}

{
const unsigned char *buf;
uint32_t tx[20], ty[20], t1[20], t2[20];
uint32_t bad;
int i;

if (len != 65) {
return 0;
}
buf = src;







bad = NEQ(buf[0], 0x04);





tx[19] = be8_to_le13(tx, buf + 1, 32);
ty[19] = be8_to_le13(ty, buf + 33, 32);
bad |= reduce_final_f256(tx);
bad |= reduce_final_f256(ty);




square_f256(t1, tx);
mul_f256(t1, tx, t1);
square_f256(t2, ty);
for (i = 0; i < 20; i ++) {
t1[i] += (F256[i] << 3) - MUL15(3, tx[i]) + P256_B[i] - t2[i];
}
norm13(t1, t1, 20);
reduce_f256(t1);
reduce_final_f256(t1);
for (i = 0; i < 20; i ++) {
bad |= t1[i];
}




memcpy(P->x, tx, sizeof tx);
memcpy(P->y, ty, sizeof ty);
memset(P->z, 0, sizeof P->z);
P->z[0] = 1;
return EQ(bad, 0);
}

{
unsigned char *buf;

buf = dst;
buf[0] = 0x04;
le13_to_be8(buf + 1, 32, P->x);
le13_to_be8(buf + 33, 32, P->y);
}

{







uint32_t qz;
p256_jacobian P2, P3, Q, T, U;




P2 = *P;
p256_double(&P2);
P3 = *P;
p256_add(&P3, &P2);




memset(&Q, 0, sizeof Q);
qz = 1;
while (xlen -- > 0) {
int k;

for (k = 6; k >= 0; k -= 2) {
uint32_t bits;
uint32_t bnz;

p256_double(&Q);
p256_double(&Q);
T = *P;
U = Q;
bits = (*x >> k) & (uint32_t)3;
bnz = NEQ(bits, 0);
CCOPY(EQ(bits, 2), &T, &P2, sizeof T);
CCOPY(EQ(bits, 3), &T, &P3, sizeof T);
p256_add(&U, &T);
CCOPY(bnz & qz, &Q, &T, sizeof Q);
CCOPY(bnz & ~qz, &Q, &U, sizeof Q);
qz &= ~bnz;
}
x ++;
}
*P = Q;
}

{
uint32_t xy[20];
uint32_t k;
size_t u;

memset(xy, 0, sizeof xy);
for (k = 0; k < 15; k ++) {
uint32_t m;

m = -EQ(idx, k + 1);
for (u = 0; u < 20; u ++) {
xy[u] |= m & Gwin[k][u];
}
}
for (u = 0; u < 10; u ++) {
T->x[(u << 1) + 0] = xy[u] & 0xFFFF;
T->x[(u << 1) + 1] = xy[u] >> 16;
T->y[(u << 1) + 0] = xy[u + 10] & 0xFFFF;
T->y[(u << 1) + 1] = xy[u + 10] >> 16;
}
memset(T->z, 0, sizeof T->z);
T->z[0] = 1;
}

{








p256_jacobian Q;
uint32_t qz;

memset(&Q, 0, sizeof Q);
qz = 1;
while (xlen -- > 0) {
int k;
unsigned bx;

bx = *x ++;
for (k = 0; k < 2; k ++) {
uint32_t bits;
uint32_t bnz;
p256_jacobian T, U;

p256_double(&Q);
p256_double(&Q);
p256_double(&Q);
p256_double(&Q);
