function.parameter_list:
(unsigned char *A, const unsigned char *B, size_t len,
const unsigned char *x, size_t xlen,
const unsigned char *y, size_t ylen, int curve)

function.block:
{
p256_jacobian P, Q;
uint32_t r, t, z;
int i;

(void)curve;
r = p256_decode(&P, A, len);
p256_mul(&P, x, xlen);
if (B == NULL) {
p256_mulgen(&Q, y, ylen);
} else {
r &= p256_decode(&Q, B, len);
p256_mul(&Q, y, ylen);
}




t = p256_add(&P, &Q);
reduce_final_f256(P.z);
z = 0;
for (i = 0; i < 20; i ++) {
z |= P.z[i];
}
z = EQ(z, 0);
p256_double(&Q);










CCOPY(z & ~t, &P, &Q, sizeof Q);
p256_to_affine(&P);
p256_encode(A, &P);
r &= ~(z & t);
return r;
}
